<!DOCTYPE html>
<html>
<head>
    <title>ConfigBot</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <meta name="robots" content="noindex, nofollow">
    <meta name="description" content="Home">
    <meta name="keywords" content="Console, Bot, Discord, Bot Console, Websocket, Socket.io, Client, Server, MiraiBot">
    <style>
        body {
    margin: 0;
    padding: 0;
    height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    transition: background-color 0.3s ease, color 0.3s ease;
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    color: white;
    font-family: Arial, sans-serif;
}

h1 {
    margin-bottom: 20px;
}

form {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 20px;
    background-color: rgba(0, 0, 0, 0.5);
    border-radius: 10px;
    box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
}

label {
    margin-bottom: 5px;
    font-weight: bold;
    font-size: 1.1em; /* Increase font size */
}

input {
    margin-bottom: 10px;
    padding: 8px; /* Increase padding */
    width: 100%;
    box-sizing: border-box;
    border-radius: 5px;
    border: 1px solid #ccc;
}

button {
    margin-top: 20px;
    padding: 10px 20px;
    background-color: #007bff;
    color: white;
    border: none;
    cursor: pointer;
    border-radius: 5px;
    transition: background-color 0.3s ease;
}

button:hover {
    background-color: #0056b3;
}


    </style>
</head>
<body>
    <h1>Configuration Form</h1>
    <form id="configForm">
        <label for="language">Language:</label>
        <input type="text" id="language" name="language" required>

        <label for="BOTNAME">BOTNAME:</label>
        <input type="text" id="BOTNAME" name="BOTNAME" required>

        <label for="PREFIX">PREFIX:</label>
        <input type="text" id="PREFIX" name="PREFIX" required>

        <label for="version">Version:</label>
        <input type="text" id="version" name="version" required>

        <button type="submit">Save</button>
    </form>
